import React, { useState } from 'react';

const PredictionCard = ({ title, modelKey, color, onPrediction }) => {
  const [formData, setFormData] = useState({
    id: '',
    open: '',
    high: '',
    low: '',
    volume: ''
  });
  const [prediction, setPrediction] = useState(null);
  const [error, setError] = useState(null);
  const [loading, setLoading] = useState(false);

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setPrediction(null);
    setError(null);

    try {
      const response = await fetch("http://localhost:5000/predict", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ ...formData, model: modelKey })
      });

      const data = await response.json();
      if (response.ok && data.prediction !== undefined) {
        setPrediction(data.prediction);
        if (onPrediction) onPrediction(data.prediction);
      } else if (data.error) {
        setError(data.error);
        if (onPrediction) onPrediction(null);
      } else {
        setError("Unknown error occurred.");
        if (onPrediction) onPrediction(null);
      }
    } catch (error) {
      setError("Error connecting to backend.");
      if (onPrediction) onPrediction(null);
    }

    setLoading(false);
  };

  return (
    <div className="card shadow-sm border-0 mb-3" style={{ borderRadius: '1rem', maxWidth: '300px', width: '100%' }}>
      <div className="card-body p-3">
        <div className="text-center mb-2">

          <img src="data:image/jpeg;base64," alt="Bitcoin"
            style={{ width: '36px', marginBottom: '0.5rem' }}
          />
          <h6 className="fw-bold mb-1" style={{ color, fontSize: '1rem' }}>{title}</h6>
        </div>
        <form onSubmit={handleSubmit}>
          <div className="mb-1">
            <input type="number" className="form-control form-control-sm" name="id" value={formData.id} onChange={handleChange} placeholder="ID" required />
          </div>
          <div className="mb-1">
            <input type="number" className="form-control form-control-sm" name="open" value={formData.open} onChange={handleChange} placeholder="Open" required />
          </div>
          <div className="mb-1">
            <input type="number" className="form-control form-control-sm" name="high" value={formData.high} onChange={handleChange} placeholder="High" required />
          </div>
          <div className="mb-1">
            <input type="number" className="form-control form-control-sm" name="low" value={formData.low} onChange={handleChange} placeholder="Low" required />
          </div>
          <div className="mb-1">
            <input type="number" className="form-control form-control-sm" name="volume" value={formData.volume} onChange={handleChange} placeholder="Volume" required />
          </div>
          <button type="submit" className="btn btn-warning btn-sm w-100 fw-bold" disabled={loading}>
            {loading ? "..." : "Predict"}
          </button>
        </form>
        {prediction !== null && (
          <div className="alert alert-success mt-2 py-1 text-center" style={{ fontSize: '0.95rem', fontWeight: 'bold' }}>
             {prediction}
          </div>
        )}
        {error && (
          <div className="alert alert-danger mt-2 py-1 text-center" style={{ fontSize: '0.95rem' }}>
            <strong>Error:</strong> {error}
          </div>
        )}
      </div>
    </div>
  );
};

export default PredictionCard;
